import Link from 'next/link';

export default function Index(props){
    return(
        <nav className="NavbarItems">
            <span className="nav_logo"></span>

            <input type="checkbox" className="menuBtn" id="menuBtn"/>
            <label className="menuIcon" for="menuBtn">
                <span className="bars"></span>
            </label>

            <ul className="nav_link">
                <li>
                    <Link href="/" >
                        Home
                    </Link>
                </li>
                <li>
                    <Link href="/news" >
                        Noticias
                    </Link>
                </li>
                <li>
                    <Link href="" >
                        Artistas
                    </Link>
                </li>
                <li>
                    <Link href="" >
                        Podcasts
                    </Link>
                </li>
            </ul>

            <style jsx>
                {`
                    .NavbarItems {
	background: linear-gradient(0deg, rgb(0, 0, 0, 1.0) 0% , rgba(0, 0, 0, 0.5) 80%, rgba(0, 0, 0, 0.5) 100%);
	backdrop-filter: blur(3px);
	padding: 0px 5%;
	margin:0px;
	position: fixed;
	top: 0;
	left: 0;
	width: 100vw;
	z-index: 10;
	box-shadow: 0px 0px 10px #000000;
	display: flex;
	align-items: center;
	align-content: space-between;
}
            `}
            </style>
        </nav>
    );
}
